        Bucket List Destinations
      </h1>
      <div>
      <div
        className="cursor-pointer text-lg font-bold bg-gray-200 p-2 rounded"
        onClick={toggleItems}
      >

      </div>
      </div>
      {isOpen ? destinations.map((destination) => {
        if (destination.category === "Beach") {
          return <Destination key={destination.id} destination={destination} />;
        };
      }): null}
    </div>
  );
}

export default DestinationList;
